import './index.css'


class  Item extends React.Component {

    render() {
      const {id,name,done}=this.props
      return (
    
           <li>
              console.log(this.props)
            <label>
              <input type="checkbox"  defaultChecked={done}/>
              <span>{name}</span>
            </label>
            <button className="btn btn-danger" style={{display:'none'}}>删除</button>
          </li>
        )
    }
}


export default Item;
